            const filterSelect = document.getElementById("filterSelect");

            const applyFilter = document.getElementById("applyFilter");
            const table = document.getElementById("jobTable");
            const loadingDiv = document.getElementById("loading");
            
            const columns = Object.keys(outlist[1]);
            columns.forEach(column => {
                const option = document.createElement("option");

                filterSelect.add(option);
            });

            function loadFilteredRows() {
                const filterValue = filterInput.value.toLowerCase();
                const filteredData = Object.values(outlist).filter(row =>

row.RECIPE.toLowerCase().includes(filterValue) ||

row.HAS_ERROR.toLowerCase().includes(filterValue) ||row.ERROR.join("").toLowerCase().includes(filterValue)
                );
                
                renderRows(filteredData);
            }
            
            function renderRows(data) {
                table.innerHTML = `

<td>${row.HAS_ERROR}</td>
